css:
@-moz-document url-prefix("https://www.e-podroznik.pl") {
body, .brief-info, #footer {
  background-color: #263238!important;
  color: #fff!important;
}
.connectionsSearcherComponent {
  background-color: #455A64!important;
  color: #fff!important;
}
.travel-part {
  color: #123;
}
.carrier-name {
  color: #fff;
}
.searching-result .brief-info .summary-info .journey-time .time-duration .days:first-child, .searching-result .brief-info .summary-info .journey-time .time-duration .hours:first-child, .departure, .arrival {
  color: #a5b7c0;
}
.connectionsSearcherComponent .connections-searcher .departureDateTime, .connectionsSearcherComponent .connections-searcher .returnDateTime, .connectionsSearcherComponent .connections-searcher .lblDate .fldContainer .fldDateV-caption {
  background-color: #37474F;
  color: #fff;
}
.button-secondary {
  background: #607D8B;
  color: #fff;
}
.button-secondary:hover, .frmButton:hover {
  background: #263238;
  border-color: #fff;
}
#topBar {
  background-color: #000;
}
.searching-result .brief-info .purchase-info {
  background: #78909C;
}
.claimBody {
  background: #122731!important;
}
.frmButton {
  background: transparent;
}
}
